package gnu.x11.keysym;


/**
 * 3270 Terminal-specific keyboard symbols. Imported from
 * <code>XK_3270</code> section of <code>/usr/include/X11/keysymdef.h</code>. 
 * Note that byte 3 = 0xfd.
 */
public class T3270 {
  public static final int DUPLICATE = 0xfd01;
  public static final int FIELD_MARK = 0xfd02;
  public static final int RIGHT2 = 0xfd03;
  public static final int LEFT2 = 0xfd04;
  public static final int BACK_TAB = 0xfd05;
  public static final int ERASE_EOF = 0xfd06;
  public static final int ERASE_INPUT = 0xfd07;
  public static final int RESET = 0xfd08;
  public static final int QUIT = 0xfd09;
  public static final int PA1 = 0xfd0a;
  public static final int PA2 = 0xfd0b;
  public static final int PA3 = 0xfd0c;
  public static final int TEST = 0xfd0d;
  public static final int ATTN = 0xfd0e;
  public static final int CURSOR_BLINK = 0xfd0f;
  public static final int ALT_CURSOR = 0xfd10;
  public static final int KEY_CLICK = 0xfd11;
  public static final int JUMP = 0xfd12;
  public static final int IDENT = 0xfd13;
  public static final int RULE = 0xfd14;
  public static final int COPY = 0xfd15;
  public static final int PLAY = 0xfd16;
  public static final int SETUP = 0xfd17;
  public static final int RECORD = 0xfd18;
  public static final int CHANGE_SCREEN = 0xfd19;
  public static final int DELETE_WORD = 0xfd1a;
  public static final int EX_SELECT = 0xfd1b;
  public static final int CURSOR_SELECT = 0xfd1c;
  public static final int PRINT_SCREEN = 0xfd1d;
  public static final int ENTER = 0xfd1e;
}
